/* eslint-disable react/prop-types */
/* eslint-disable no-unused-vars */

import React from "react";

const ListPeople = ({ People }) => {
  return (
    <>
      {People.map(( person ) => {
        const { id , name , age , image } = person;
        return (
          <article key={id} className="person">
            <img src={image} />
            <h4>{name}</h4>
            <p>{age} years</p>
          </article>
        );
      })}
    </>
  );
};

export default ListPeople;
